import { AndréTamião, Container, Contato, GuiasContainer, Início, Logo, Serviços } from "./styles";
import logo from "../assets/logodireito.png"

function Header(){
    return(
        <Container>
            <Logo></Logo>
            <GuiasContainer>
                <Início>Início</Início>
                <AndréTamião>André Tamião</AndréTamião>
                <Contato>Contato</Contato>
                <Serviços>Serviços</Serviços>
            </GuiasContainer>
        </Container>
    )
}

export default Header;
